import React from 'react';
import { Link } from 'react-router-dom';
import './ContactInfo.css';

const contactInfo = () => {

    return (
        <div className='container'>
            <div className='contactInfo'>
                <h4 className='email'>Email:<Link to='mailto:admin@mongobyte.com'> admin@mongobyte.com</Link></h4>
                <div className='streetAddress'>
                    <h4 className='mailto'>Send mail to:</h4>
                    <h4 className='name'>MongoByte</h4> 
                    <h4 className='address1'>1218 Bliss Dr</h4>
                    <h4 className='address2'>St. Louis, MO 63137</h4>
                </div>
            
                <div className='choice'>
                    <h4 className='choose'>Or you can just fill out the form below:</h4>
                </div></div>
        </div>
    );
};

export default contactInfo;
